import React from 'react';
import styled from 'styled-components';

const TopBanner = styled.div`
  width: 95%;
`;

const Home = () => {
  return (
    <div>
      <TopBanner>
        <div>
          <div>Banner1</div>
          <div>Banner2</div>
          <div>Banner3</div>
        </div>
        <div>Banner4</div>
      </TopBanner>
    </div>
  );
};

Home.getInitialProps = async context => {
  return true;
};

export default Home;
